END=5
STARTTIME=$(date +%s)
x=$END 
while [ $x -gt 0 ]; 
do 
  echo "----> NEW REQUESTS - COUNTING DOWN: " $x
  curl -X GET -H 'Content-Type: application/json' -i 'http://0.0.0.0:8000/mirror/names'
  curl -X POST -H 'Content-Type: application/json' -i 'http://127.0.0.1:8000/mirror/tellmewho' --data '{"img": ""}'
  curl -X POST -H 'Content-Type: application/json' -i 'http://127.0.0.1:8000/mirror/showmewho' --data '{"img": ""}'
  x=$(($x-1))
  echo -e " \n"
  echo -e " \n"
  sleep .1
done
ENDTIME=$(date +%s)
echo "It takes $(($ENDTIME - $STARTTIME)) seconds"